import Contact from './routes/Contact';
import { Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <Route>
        <Route element={<Home />}/>
      </Route>
     <Navbar />

    </div>
  );
}

export default App;
